import React from 'react';


const TodoList = (props) => {

    const {id, task, completed} = props;

    return(
        <div className = 'todo-item'
            id = {id}
            completed = {completed}
            onClick = {() => props.toggleItem({id})}
        >
            <p> {task}</p>
        </div>
    )
}

 export default TodoList;
